import { Component, OnInit } from '@angular/core';
import { Car } from '../car.model'; // Importe a interface Car ou qualquer outro modelo que você esteja usando
import { GarageService } from '../garage.service'; // Importe o serviço GarageService ou qualquer outro serviço que você esteja usando

@Component({
  selector: 'app-historico',
  templateUrl: './historico.component.html',
  styleUrls: ['./historico.component.css']
})
export interface Car {
  name: string;
  licence: string;
  time: string;
  owner: string;
}


export class HistoricoComponent implements OnInit {
  historico: Car[] = [];

  constructor(private garageService: GarageService) { }

  ngOnInit(): void {
    this.historico = this.garageService.getHistorico(); // Obtenha o histórico de veículos do serviço GarageService ou de qualquer outra fonte de dados
  }
}
